__device__ __forceinline__ void find_pivot_and_rotate(double* A, const int n, double* E, bool updateEigenVectors) {
    // Initialize maximum value and indices for pivot element
    int p = -1;
    int q = -1;

    for (unsigned int iteration = 0; iteration < 5; iteration++){
        double max_value = 0.0;
        // Find the indices of the largest off-diagonal element in A
        for (int i = 0; i < n; ++i) {
            for (int j = i + 1; j < n; ++j) {  // Only upper triangular part
                if (fabsf(A[i * n + j]) > max_value) {
                    max_value = fabsf(A[i * n + j]);
                    p = i;
                    q = j;
                }
            }
        }

        // Perform the rotation
        double a_pp = A[p * n + p];
        double a_qq = A[q * n + q];
        double a_pq = A[p * n + q];

        // Calculate the rotation angle
        double theta = 0.5 * atan2f(2.0 * a_pq, a_qq - a_pp);
        double c = cosf(theta);
        double s = sinf(theta);

        // Perform the rotation
        for (int i = 0; i < n; ++i) {
            if (i != p && i != q) {
                double a_ip = A[i * n + p];
                double a_iq = A[i * n + q];
                A[i * n + p] = c * a_ip - s * a_iq;
                A[i * n + q] = s * a_ip + c * a_iq;
                A[p * n + i] = A[i * n + p];  // Since A is symmetric
                A[q * n + i] = A[i * n + q];  // Since A is symmetric
            }
        }

        // Update the diagonal elements
        A[p * n + p] = c * c * a_pp + s * s * a_qq - 2.0f * s * c * a_pq;
        A[q * n + q] = s * s * a_pp + c * c * a_qq + 2.0f * s * c * a_pq;

        // Zero out the pivot element
        A[p * n + q] = 0.0f;
        A[q * n + p] = 0.0f;  // Since A is symmetric

        if (updateEigenVectors){
        // Update the rotation matrix
        for (int i = 0; i < n; ++i) {
            double e_ip = E[i * n + p];
            double e_iq = E[i * n + q];
            E[i * n + p] = c * e_ip - s * e_iq;
            E[i * n + q] = s * e_ip + c * e_iq;
        }
        }
    }
}


__device__ void householderQR(const double *A, double *Q, double *R, int n) {
    // Copy A into R and initialize Q as the identity matrix
    for (int i = 0; i < n * n; ++i) {
        R[i] = A[i];
        Q[i] = (i % (n + 1) == 0) ? 1.0 : 0.0; // Identity matrix
    }

    for (int k = 0; k < n - 1; ++k) {
        // Compute the Householder vector for the k-th column
        double norm_x = 0.0;
        for (int i = k; i < n; ++i) {
            norm_x += R[i * n + k] * R[i * n + k];
        }
        double alpha = -copysign(sqrt(norm_x), R[k * n + k]);
        double r = sqrt(0.5 * alpha * alpha - 0.5 * R[k * n + k] * alpha);
        double v[12] = {0}; // Assuming n = 12
        v[k] = (R[k * n + k] - alpha) / (2.0 * r);
        for (int i = k + 1; i < n; ++i) {
            v[i] = R[i * n + k] / (2.0 * r);
        }

        // Apply the transformation to R and Q
        for (int j = k; j < n; ++j) {
            double sum = 0.0;
            for (int i = k; i < n; ++i) {
                sum += v[i] * R[i * n + j];
            }
            for (int i = k; i < n; ++i) {
                R[i * n + j] -= 2.0 * v[i] * sum;
            }
        }

        for (int j = 0; j < n; ++j) {
            double sum = 0.0;
            for (int i = k; i < n; ++i) {
                sum += v[i] * Q[j * n + i];
            }
            for (int i = k; i < n; ++i) {
                Q[j * n + i] -= 2.0 * v[i] * sum;
            }
        }
    }
}



__device__ __forceinline__ void qr_12_tri_diagonal(double A[144], double E[144], bool updateEigenVectors){
    double Q[144];
    double R[144];
    for (int i = 0; i < 144; ++i) {
        Q[i] = 0.0;
        R[i] = 0.0;
    }
    double ACopy[144];
    for (int i = 0; i < 144; ++i) {
        ACopy[i] = A[i];
    }

    double eq[144];
    double e_tmp, q_tmp;

    for (unsigned int iteration = 0; iteration < 21; iteration++){
        double ACopyCopy[144];
        for (unsigned int i = 0; i < 144; i++) ACopyCopy[i] = ACopy[i];
        // compute_qr_tri_diagonal_0(ACopy, Q, R);
        // compute_qr_tri_diagonal_6(ACopy, Q, R);
        // compute_qr_tri_diagonal_8(ACopy, Q, R);
        // compute_qr_tri_diagonal_10(ACopy, Q, R);
        householderQR(ACopy, Q, R, 12);
        double relativeChange = 0;
        

        // compute ACopy = R * Q
        unsigned int i = 0;
        unsigned int j = 0;

        i = 0;
        j = 0;
        ACopy[i * 12 + j] = 0.0;
        for (unsigned int k = i; k < 12; k++){
            ACopy[i * 12 + j] += R[i * 12 + k] * Q[k * 12 + j];
        }
        i = 0;
        j = 1;
        ACopy[i * 12 + j] = 0.0;
        for (unsigned int k = i; k < 12; k++){
            ACopy[i * 12 + j] += R[i * 12 + k] * Q[k * 12 + j];
        }
        ACopy[j * 12 + i] = ACopy[i * 12 + j];

        for (i = 1; i < 11; i++){
            j = i;
            ACopy[i * 12 + j] = 0.0;
            for (unsigned int k = i; k < 12; k++){
                ACopy[i * 12 + j] += R[i * 12 + k] * Q[k * 12 + j];
            }
            j+= 1;
            ACopy[i * 12 + j] = 0.0;
            for (unsigned int k = i; k < 12; k++){
                ACopy[i * 12 + j] += R[i * 12 + k] * Q[k * 12 + j];
            }
            ACopy[j * 12 + i] = ACopy[i * 12 + j];
        }
        i = 11;
        j = 11;
        ACopy[i * 12 + j] = 0.0;
        for (unsigned int k = i; k < 12; k++){
            ACopy[i * 12 + j] += R[i * 12 + k] * Q[k * 12 + j];
        }

        if (updateEigenVectors){
            // E = E * Q
            for (unsigned int i = 0; i < 12; i++){
                for (unsigned int j = 0; j < 12; j++){
                    double sum = 0.0;
                    for (unsigned int k = 0; k < 12; k++){
                        e_tmp = E[i * 12 + k];
                        q_tmp = Q[k * 12 + j];
                        sum += e_tmp * q_tmp;
                    }
                    eq[i * 12 + j] = sum;
                }
            }
            for (unsigned int i = 0; i < 144; i++){
                E[i] = eq[i];
            }
        }
        for (unsigned int i = 0; i < 11; i++){
            relativeChange += fabs(ACopy[i * 12 + i] - ACopyCopy[i * 12 + i]) + fabs(ACopy[i * 12 + i + 1] - ACopyCopy[i * 12 + i + 1]);
        }
        relativeChange += fabs(ACopy[12 * 12 - 1] - ACopyCopy[12 * 12 - 1]);
        if (relativeChange < 1e-1){
            printf("Break with small change\n");
            break;
        }

    }





    // now we do the jacobi iterations
    bool keepDoingJacobian = true;
    while (keepDoingJacobian){
        find_pivot_and_rotate(ACopy, 12, E, updateEigenVectors);
        keepDoingJacobian = false;
        for (int i = 0; i < 12; i++){
            for (int j = i + 1; j < 12; j++){
                double absv = fabsf(ACopy[i * 12 + j]);
                if (absv > 1e-6){
                    keepDoingJacobian = true;
                    break;
                }
            }
        }
    }

    for (unsigned int i = 0; i < 12; i++){
        A[i * 12 + i] = ACopy[i * 12 + i];
    }
}